import axios from 'axios';

export function getParkings(location) {
    const params = {
        limit: 6,
        term: 'parking',
        location: location,
        offset: 0,
        Auth: process.env.REACT_APP_API_KEY
    }
    return (dispatch) => {
        return axios.get("https://api.yelp.com/v3/businesses/search?limit=5&term=Parking &location=San Francisco&offset=4", {
            headers: {
                Authorization: `Bearer 7dq_mpXibH16XJ_nNT2Ynezgvd7B56kuJFPGF-37LD8f09jkZdx4-fU6s5PZARhEEUB-MTbIiKT1ZquJ5nFq1QG7T3WblddHPj26WJDry-mELsVFj2fnOTImxgH4YHYx`
            }
